import React, {useState} from "react"
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import { makeStyles } from '@material-ui/core/styles';
import Mask from "./masks";
import Travel from "./travel";
import Practice from "./practices";
import Pregnent from "./pregnency";
import Stress from "./stress";
import Parent from "./parenting";
import Myth from "./myth";
import Safe from "./safe";
import { AutoLayout } from "devextreme-react/diagram";

const useStyles = makeStyles((theme) => ({
    formControl: {
      position:"relative",
    //   margin: theme.spacing(1),
      top:300,
      width:200,
      minWidth: 120,
      margin:"auto",
      zIndex:"3",
      backgroundColor:"white"
    },
    selectEmpty: {
      marginTop: theme.spacing(2),
    },
  }));

export default function Aware() {
    const classes = useStyles();
    const [aware, setAware] = useState(0);

    function show() {
        if(aware==0)
            return(
                <Safe />
            );
        else if(aware==1)
            return(
                <Practice />
            )
        else if(aware==2)
            return (
                <Myth />
            )
        else if(aware==3)
            return(
                <Mask />
            )
        else if(aware==4)
            return(
                <Parent /> 
            )
        else if(aware==5)
            return(
                <Stress />
            )
        else if(aware==6)
            return(
                <Travel />
            )
        else if(aware==7)
            return(
                <Pregnent />
            )    
    }

    function handleChange(event) {
        setAware(event.target.value);
      }
    

    return (<div>
        <FormControl className={classes.formControl}>
        {/* <InputLabel id="demo-simple-select-label">Age</InputLabel> */}
        <Select
          labelId="SelectChart"
          id="demo-simple-select"
          value={aware}
          onChange={handleChange}
        >
          <MenuItem value={0}>{"hbsc"}</MenuItem>
          <MenuItem value={1}>{"sdcsdc"}</MenuItem>
          <MenuItem value={2}>{"dcsdv"}</MenuItem>
          <MenuItem value={3}>{"ascasc"}</MenuItem>
        </Select>
      </FormControl>
      <div className="aware">
        {show}
      </div>
      </div>
    )
    

}
